[{'image_path': 'https://image.tmdb.org/t/p/original/olxpyq9kJAZ2NU1siLshhhXEPR7.jpg', 'title': 'Spider-Man 2', 'realease_date': '2004-06-25', 'genres': 'Action Adventure Fantasy', 'runtime': 127, 'user_rating': 7.246, 'overview': "Peter Parker is going through a major identity crisis. Burned out from being Spider-Man, he decides to shelve his superhero alter ego, which leaves the city suffering in the wake of carnage left by the evil Doc Ock. In the meantime, Parker still can't act on his feelings for Mary Jane Watson, a girl he's loved since childhood. A certain anger begins to brew in his best friend Harry Osborn as well...", 'cast': [{'original_name': 'Tobey Maguire', 'character': 'Spider-Man / Peter Parker', 'image_path': 'https://image.tmdb.org/t/p/original//kOJelnLSb89SeivbOCt1l94Hz2d.jpg'}, {'original_name': 'Kirsten Dunst', 'character': 'Mary Jane Watson', 'image_path': 'https://image.tmdb.org/t/p/original//6RAAxI4oPnDMzXpXWgkkzSgnIAJ.jpg'}, {'original_name': 'James Franco', 'character': 'Harry Osborn', 'image_path': 'https://image.tmdb.org/t/p/original//rShzuvrQJJQJ6lXDn3IQX4o0iCE.jpg'}, {'original_name': 'Alfred Molina', 'character': 'Doc Ock / Otto Octavius', 'image_path': 'https://image.tmdb.org/t/p/original//nJo91Czesn6z0d0pkfbDoVZY3sg.jpg'}, {'original_name': 'Rosemary Harris', 'character': 'May Parker', 'image_path': 'https://image.tmdb.org/t/p/original//rpSsXg0tB7wWQMffvvMqLzrvZAj.jpg'}]}, {'image_path': 'https://image.tmdb.org/t/p/original/gh4cZbhZxyTbgxQPxD0dOudNPTn.jpg', 'title': 'Spider-Man', 'realease_date': '2002-05-01', 'genres': 'Fantasy Action', 'runtime': 121, 'user_rating': 7.27, 'overview': 'After being bitten by a genetically altered spider at Oscorp, nerdy but endearing high school student Peter Parker is endowed with amazing powers to become the superhero known as Spider-Man.', 'cast': [{'original_name': 'Tobey Maguire', 'character': 'Spider-Man / Peter Parker', 'image_path': 'https://image.tmdb.org/t/p/original//kOJelnLSb89SeivbOCt1l94Hz2d.jpg'}, {'original_name': 'Willem Dafoe', 'character': 'Green Goblin / Norman Osborn', 'image_path': 'https://image.tmdb.org/t/p/original//ui8e4sgZAwMPi3hzEO53jyBJF9B.jpg'}, {'original_name': 'Kirsten Dunst', 'character': 'Mary Jane Watson', 'image_path': 'https://image.tmdb.org/t/p/original//6RAAxI4oPnDMzXpXWgkkzSgnIAJ.jpg'}, {'original_name': 'James Franco', 'character': 'Harry Osborn', 'image_path': 'https://image.tmdb.org/t/p/original//rShzuvrQJJQJ6lXDn3IQX4o0iCE.jpg'}, {'original_name': 'Cliff Robertson', 'character': 'Ben Parker', 'image_path': 'https://image.tmdb.org/t/p/original//8pH2RWCPtXKzT9P33MbzgnzPlF0.jpg'}]}, {'image_path': 'https://image.tmdb.org/t/p/original/c3e9e18SSlvFd1cQaGmUj5tqL5P.jpg', 'title': 'The Amazing Spider-Man 2', 'realease_date': '2014-04-16', 'genres': 'Action Adventure Fantasy', 'runtime': 141, 'user_rating': 6.49, 'overview': 'For Peter Parker, life is busy. Between taking out the bad guys as Spider-Man and spending time with the person he loves, Gwen Stacy, high school graduation cannot come quickly enough. Peter has not forgotten about the promise he made to Gwen’s father to protect her by staying away, but that is a promise he cannot keep. Things will change for Peter when a new villain, Electro, emerges, an old friend, Harry Osborn, returns, and Peter uncovers new clues about his past.', 'cast': [{'original_name': 'Andrew Garfield', 'character': 'Peter Parker / Spider-Man', 'image_path': 'https://image.tmdb.org/t/p/original//9hJ59ogLxgcZDkvfGcjLHqbB5Pl.jpg'}, {'original_name': 'Emma Stone', 'character': 'Gwen Stacy', 'image_path': 'https://image.tmdb.org/t/p/original//3UaYw9KF4fEXRMRWhf25aGJpAW2.jpg'}, {'original_name': 'Jamie Foxx', 'character': 'Max Dillon / Electro', 'image_path': 'https://image.tmdb.org/t/p/original//oZa2WXbsXRfJp7eI2oorREAaDrd.jpg'}, {'original_name': 'Dane DeHaan', 'character': 'Harry Osborn / Green Goblin', 'image_path': 'https://image.tmdb.org/t/p/original//uwl0WKqHj6ahsriOEPLks84T70j.jpg'}, {'original_name': 'Colm Feore', 'character': 'Donald Menken', 'image_path': 'https://image.tmdb.org/t/p/original//oOxcf1qB1IvVZrBEE1PdrfMiyBK.jpg'}]}, {'image_path': 'https://image.tmdb.org/t/p/original/jIfkQNARYyERqRAq1p1c8xgePp4.jpg', 'title': 'The Amazing Spider-Man', 'realease_date': '2012-06-23', 'genres': 'Action Adventure Fantasy', 'runtime': 136, 'user_rating': 6.686, 'overview': "Peter Parker is an outcast high schooler abandoned by his parents as a boy, leaving him to be raised by his Uncle Ben and Aunt May. Like most teenagers, Peter is trying to figure out who he is and how he got to be the person he is today. As Peter discovers a mysterious briefcase that belonged to his father, he begins a quest to understand his parents' disappearance – leading him directly to Oscorp and the lab of Dr. Curt Connors, his father's former partner. As Spider-Man is set on a collision course with Connors' alter ego, The Lizard, Peter will make life-altering choices to use his powers and shape his destiny to become a hero.", 'cast': [{'original_name': 'Andrew Garfield', 'character': 'Peter Parker / Spider-Man', 'image_path': 'https://image.tmdb.org/t/p/original//9hJ59ogLxgcZDkvfGcjLHqbB5Pl.jpg'}, {'original_name': 'Emma Stone', 'character': 'Gwen Stacy', 'image_path': 'https://image.tmdb.org/t/p/original//3UaYw9KF4fEXRMRWhf25aGJpAW2.jpg'}, {'original_name': 'Rhys Ifans', 'character': 'Dr. Curt Connors / The Lizard', 'image_path': 'https://image.tmdb.org/t/p/original//g8EUs8r1ECh9plKtrxBparsxlZ1.jpg'}, {'original_name': 'Denis Leary', 'character': 'Captain Stacy', 'image_path': 'https://image.tmdb.org/t/p/original//nAqHuIw8z1QodcXdaJQShKogVFa.jpg'}, {'original_name': 'Martin Sheen', 'character': 'Uncle Ben', 'image_path': 'https://image.tmdb.org/t/p/original//m2Y3Q0uyuW6htrn2W9UWCWMkpZu.jpg'}]}, {'image_path': 'https://image.tmdb.org/t/p/original/lHjpwv1Yv2RcGcTQb4Lc1cKw1y9.jpg', 'title': 'Arachnophobia', 'realease_date': '1990-07-20', 'genres': 'Comedy Horror', 'runtime': 109, 'user_rating': 6.368, 'overview': "A large spider from the jungles of South America is accidentally transported in a crate with a dead body to America where it mates with a local spider. Soon after, the residents of a small California town disappear as the result of spider bites from the deadly spider offspring. It's up to a couple of doctors with the help of an insect exterminator to annihilate these eight legged freaks.", 'cast': [{'original_name': 'Jeff Daniels', 'character': 'Dr. Ross Jennings', 'image_path': 'https://image.tmdb.org/t/p/original//euWbAkBUyr74XKgyU3NYyTVRYr1.jpg'}, {'original_name': 'Harley Jane Kozak', 'character': 'Molly Jennings', 'image_path': 'https://image.tmdb.org/t/p/original//9BMCJq4owniBRXkf8y8kEN12JTS.jpg'}, {'original_name': 'John Goodman', 'character': 'Delbert McClintock', 'image_path': 'https://image.tmdb.org/t/p/original//yyYqoyKHO7hE1zpgEV2XlqYWcNV.jpg'}, {'original_name': 'Julian Sands', 'character': 'Doctor James Atherton', 'image_path': 'https://image.tmdb.org/t/p/original//8TYtEyKZle2B3cUYT7FBM9HJRtZ.jpg'}, {'original_name': 'Brian McNamara', 'character': 'Chris Collins', 'image_path': 'https://image.tmdb.org/t/p/original//pPuMmkeEQj7JPvxclKYXLacwHW7.jpg'}]}]